// estilo de panel de navegación

const drawerWidth = 240;
export const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  submit: {
    marginRight: 'auto',
    marginLeft: theme.spacing.unit * 3,
  },
  drawer: {
    [theme.breakpoints.up('sm')]: {
      width: drawerWidth,
      flexShrink: 0,
    },
  },
  appBar: {
    marginLeft: drawerWidth,
    [theme.breakpoints.up('sm')]: {
      width: `calc(100% - ${drawerWidth}px)`,
    },
  },
  menuButton: {
    marginRight: 20,
    [theme.breakpoints.up('sm')]: {
      display: 'none',
    },
  },
  toolbar: theme.mixins.toolbar,
  drawerPaper: {
    width: drawerWidth,
  },
});
//estilo de color panel
